import React from "react";
import { useParams } from "react-router-dom";

const PackageDetails = () => {
  const { id } = useParams();

  return (
    <div style={{ padding: "20px" }}>
      <h2>Package Details</h2>
      <p>Details for package ID: {id}</p>
    </div>
  );
};

export default PackageDetails;
